import React from "react";

function LoginInput(props) {
    return (
        <div className="name-input">
            <span className="input-placeholder">
                {props.placeholder}
            </span>
            <input
            type="text"
            name="user-name"
            id="user-name"
            className="log-input"
            />
        </div>
    );
}

export default LoginInput;
